import { NavLink, Outlet, useParams } from "react-router-dom";
import { getDiploma } from "../api";

export default function Diploma() {
  const { diplomaId } = useParams();
  const diploma = getDiploma(diplomaId);

  if (!diploma) return <div className="hint">Diploma not found.</div>;

  return (
    <div className="detail">
      <div className="detail-head">
        <div className="pill">{diploma.id}</div>
        <h2 className="detail-title">{diploma.name}</h2>
        <p className="detail-desc">{diploma.description}</p>
      </div>

      <h3 className="sub-title">Modules</h3>

      <div className="modules">
        {diploma.modules.map((m) => (
          <NavLink key={m.id} to={m.id} className="module-card">
            <div className="module-top">
              <span className="pill soft">{m.id}</span>
              <span className="muted">{m.level}</span>
            </div>
            <div className="module-title">{m.name}</div>
            <div className="module-meta">{m.duration}</div>
          </NavLink>
        ))}
      </div>

      <div className="outlet">
        <Outlet />
      </div>
    </div>
  );
}
